INSERT INTO `customer_information` VALUES ('2', '正通物流有限公司', '<p><span style=\"color: rgb(51, 51, 51); font-family: Verdana, Arial; font-size: 14px; background-color: rgb(255, 255, 255);\">天津 正通物流配送有限公司是天津地区知名的配送服务企业，自加入天津酷企网网络平台初就秉承&quot;诚信经营&quot;理念，得到大众的广泛认可和支持！天津 正通物流配送有限公司介绍如下： 公司拥有数百部以轻卡厢货、微型厢货为统一标准配置的专用配送车辆, 采用先进的通讯、调度监控系统, 可满足不同客户多样化、个性化的需求。960569公众客服热线及公司网站(www.tjztwl.com), 可进行即时信息交换, 为客户和物流企业提供信息服务。 公司以市场需求为导向、以用户满意为目标。可为客户提供门到门全过程、全方位、高水平、高质量的物流配送服务。 公司主要经营项目为：商品物流配送、国内货运代理、公路货物运输、货物储存、劳务服务（搬倒装卸）、货物分类、包装服务、物流信息咨询服务等。公司下设若干个分公司和企业, 其中路通大型物件运输服务有限公司、交通青年实业公司、交通石油公司系法人企业, 主要从事普通货运、集装箱运输、大件运输、道路运输服务、货运代理、仓储、理货、起重搬倒、装卸、物流信息咨询服务、道路运输辅助服务、机电设备租赁、成品油销售等。 公司拥有一批精通物流运作的专业人才, 可为客户设计提供个性化的物流服务方案, 并按照统一的流程和标准进行业务运作。天津市正通物流配送有限公司（简称正通物流公司）是按照现代企业制度组建的以从事城市物流配送服务为主的第三方物流企业。具有完善规范的管理体系, 运转高效的经营机制, 优质良好的服务功能, 以现代物流理念引领企业的发展。 公司标有正通物流标识的微型厢式配送车辆遍布于全市主要商贸集散地、穿梭于城市的大街小巷, 以“小、快、灵”的优势为客户提供即时、便捷的配送全程服务。天津 正通物流配送有限公司致力于成为天津地区配送服务行业中的诚信企业，天津 正通物流配送有限公司地址：天津市南开区红旗南路彩虹花园1号楼2门4～5楼，欢迎拨打联系电话022-23952253，热切期待您的垂询合作。</span></p>', '2016-11-15 10:31:22', 'http://139.129.235.40/ztcms.qxsxstudio.com//pic/thumbnail/customerInfo/581850bec76f4.jpg', 'http://139.129.235.40/ztcms.qxsxstudio.com//pic/banner/customerInfo/582baf46cf022.jpg', 'http://139.129.235.40/ztcms.qxsxstudio.com//pic/detailsPic/customer/581850c7c9c46.jpg');
INSERT INTO `customer_information` VALUES ('4', '中欧运输', '<p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">前段时间，来自重庆的26袋邮包完成了一次“特殊”的旅程。它们搭乘“中欧·渝新欧”班列从重庆出发，15天后顺利抵达德国法兰克福邮件处理中心，截至10月21日，已全部成功投递。<br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　业内人士认为，此次中欧班列全程运邮测试的成功，开辟了性价比更高的国际邮包运输新模式，将带动跨境电商迅速发展，开启“买卖全球”的贸易新格局，更意味着我国与“一带一路”沿线国家的经贸、文化交流将从“大动脉”深入到“毛细血管”。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><strong><br/></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><strong>　　中欧班列首次实现全程运邮</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　9月29日，26袋邮包，共计139件邮件搭乘“中欧·渝新欧”班列从重庆出发，15天后顺利抵达德国法兰克福邮件处理中心，截至目前已全部成功投递。这标志着中欧班列首次全程运邮测试成功。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　近年来，跨境电商“全球购”热潮日益兴起，但传统的国际邮路主要集中在海运和空运，不但运力明显不足，且海运耗时过长，空运运量小、成本过高。若能通过中欧班列运输邮包，时间将比海运节约20多天，成本仅为空运的五分之一，将开辟一条性价比更高的国际邮路。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　今年5月，海关总署正式批准重庆成为国内首个中欧班列运邮试点城市。7月，海关总署批复同意利用“中欧·渝新欧”班列开展运邮测试。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　中欧班列运邮试点为何选择重庆？重庆海关相关负责人表示，重庆地处“一带一路”战略和长江经济带“Y”字形联接点，区位优势明显，“渝新欧”班列是国内最早开行、最成熟的中欧班列，货运量占所有中欧班列货运量的将近50％。此外，作为全国首批跨境贸易电子商务服务试点城市之一，去年重庆跨境电商进出口总额已从两年前的6000万元发展到60亿元，铁路运邮需求强烈。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　据介绍，重庆海关在通关模式方面实现了“三个首次”，确保此次运邮测试的成功。一是首次将安全智能关锁运用到“渝新欧”班列国内段监管，实现启运地、中转地、出境地海关通过安全智能锁统一实施监管；二是首次在中欧班列上实现了海关通关与邮政作业系统的数据共享；三是首次实现中欧国际铁路运邮电子化通关，通过关锁直接存储、读取“邮件详情单、邮件清单、邮件路单”等通关信息，实现出境地海关不掏箱、不改变运输方式监管邮件原箱原车出境。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><strong><br/></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><strong>　　开创中欧国际铁路运邮先河</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　中欧班列全程运邮测试成功，开创了中欧国际铁路运邮的先河。此前，中欧班列从未装载、运输国际邮包，全程运邮的实现，得益于重重障碍的成功突破。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　铁路合作组织（OSJD）于1956年颁布的《国际铁路货物联运协定》明文规定，“在国际铁路直通货物联运中不准运送邮政专运物品”。这是中欧班列实现全程运邮的最大障碍。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　2014年以来，重庆市就“渝新欧”运邮事宜多次与海关总署、国家铁路局、中国邮政集团公司、中国铁路总公司，以及沿线各国铁路部门进行沟通协调。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　在多方共同努力下，情况开始发生改变。当年3月，在铁路合作组织召开的运量计划会上，我国铁路部门在会上提出了修改《协定》中有关禁止运邮规定的申请，得到了与会各国铁路部门的普遍响应。6月初，铁路合作组织在立陶宛召开政府层面会议，讨论通过了新版《协定》，其中删除了对禁止运输邮政专用品的相关描述。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　此后，沿线国家推动中欧铁路常态运邮的协调工作逐步展开。去年10月，万国邮联在瑞士伯尔尼召开利益相关方会议；今年3月，万国邮联与国际铁路运输委员会和跨西伯利亚运输协调理事会签订了谅解备忘录；今年4月，中国邮政开展了利用国际客运列车将邮件运往俄罗斯的测试……</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　今年4月举行的中国（重庆）跨境电商邮政高层论坛上，沿线各国邮政以《重庆宣言》的方式正式确定了“各国合作利用中欧铁路开展铁路运邮，提供与跨境电商相适应的陆路运输方式”这一原则，具有里程碑式的意义。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　中国邮政重庆分公司相关负责人介绍，此次运邮测试成功后，中国邮政将在“渝新欧”起点——重庆西部物流园建设铁路口岸国际邮件处理中心，集邮政速递物流类邮件、进出口国际邮件处理（含跨境电商邮件）和国际快件监管等功能于一体，第一期工程将于明年建成投入使用。此外，重庆正在进行陆运国际邮件互换站、保税跨境电子商务邮件仓储和分拨中心等规划布局工作，为中欧班列运邮常态化提供有力支撑。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><strong><br/></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><strong>　　开启“买卖全球”新格局</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><strong><br/></strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　业内人士认为，中欧班列全程运邮的实现，开辟了性价比更高的国际邮包运输新模式，将带动跨境电商迅速发展，开启“买卖全球”的贸易新格局，推动我国内陆地区与“一带一路”战略的深度衔接。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　“此前，物流体系不完善是制约跨境电商发展的最大障碍，中欧班列运邮具有时间固定、禁限寄种类少和不受天气限制等优势，将打破跨境电商发展的物流瓶颈。”跨境电商企业西港全球购总经理李文等表示，国内消费者动动手指即可“买遍全球”，享用世界各国的名品优品，而更多的“中国制造”也可借此走向世界，“买卖全球”的国际贸易新格局即将开启。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　与此同时，全程运邮的实现，对于中欧班列也具有重要意义。重庆市经信委副主任、物流办主任杨丽琼说，货源短缺是中欧班列普遍面临的难题，国际邮包增长潜力巨大，未来实现常态化运邮后，将成为中欧班列的主力货源之一，助推班列双向常态化运行。</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-family: Verdana, Arial, Helvetica, sans-serif, 宋体; font-size: 14px; line-height: 25.2px;\">　　“中欧班列运邮的实现，意味着中国与‘一带一路’沿线国家的经贸、文化交流将从‘大动脉’深入到‘毛细血管’。”中国交通物流协会联运分会秘书长李牧原表示，中欧班列运邮的实现契合“一带一路”战略，将推动我国内陆地区与“一带一路”的深度衔接，演绎出更为精彩的经济故事。</p><p><br/></p>', '2016-11-16 08:58:25', 'http://139.129.235.40/ztcms.qxsxstudio.com//pic/thumbnail/customerInfo/582baf2c18bf9.png', 'http://139.129.235.40/ztcms.qxsxstudio.com//pic/banner/customerInfo/582baf3919679.png', 'http://139.129.235.40/ztcms.qxsxstudio.com/pic//detailsPic/customer/582baf2f34500.png');
