INSERT INTO `information` VALUES ('15', '天津正通物流配送有限公司', '<p><span style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; background-color: rgb(255, 255, 255);\">天津市正通物流配送有限公司（简称正通物流公司）是天津市交通集团公司全资子公司，是按照现代企业制度组建的以从事城市物流配送服务为主的第三方物流企业。具有完善规范的管理体系，运转高效的经营机制，优质良好的服务功能，以现代物流理念引领企业的发展。</span><br style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; background-color: rgb(255, 255, 255);\">公司主要经营项目为：商品物流配送、国内货运代理、公路货物运输、货物储存、劳务服务（搬倒装卸）、货物分类、包装服务、物流信息咨询服务等。公司下设若干个分公司和企业，其中路通大型物件运输服务有限公司、交通青年实业公司、交通石油公司系法人企业，主要从事普通货运、集装箱运输、大件运输、道路运输服务、货运代理、仓储、理货、起重搬倒、装卸、物流信息咨询服务、道路运输辅助服务、机电设备租赁、成品油销售等。</span><br style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; background-color: rgb(255, 255, 255);\">公司标有正通物流标识的微型厢式配送车辆遍布于全市主要商贸集散地、穿梭于城市的大街小巷，以“小、快、灵”的优势为客户提供即时、便捷的配送全程服务。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; background-color: rgb(255, 255, 255);\">公司拥有一批精通物流运作的专业人才，可为客户设计提供个性化的物流服务方案，并按照统一的流程和标准进行业务运作。</span><br style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; background-color: rgb(255, 255, 255);\">公司拥有数百部以轻卡厢货、微型厢货为统一标准配置的专用配送车辆，采用先进的通讯、调度监控系统，可满足不同客户多样化、个性化的需求。4006-561-569公众客服热线及公司网站(www.tjztwl.com)，可进行即时信息交换，为客户和物流企业提供信息服务。</span><br style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(34, 34, 34); font-family: 瀹嬩綋; font-size: 12px; background-color: rgb(255, 255, 255);\">公司以市场需求为导向、以用户满意为目标。可为客户提供门到门全过程、全方位、高水平、高质量的物流配送服务。</span></p>', '2017-01-12 17:41:57', 'http://139.129.235.40/ztcms.qxsxstudio.com//pic/thumbnail/driverInfo/5877492e8ce9d.png', 'http://139.129.235.40/ztcms.qxsxstudio.com//pic/banner/driverInfo/5877495eb4971.png', 'http://139.129.235.40/ztcms.qxsxstudio.com//pic/detailsPic/driver/587749359927d.png');
